import { Link } from "react-router-dom";
export default function Review(props) {
  const title = props.title;
  const body = props.body;
  const name = props.name;

  return (
    <div>
      <h3>{title}</h3>
      <small>
        <strong>{name}</strong>
      </small>
      <p>{body}</p>
      <Link to="/reviews/new" className="btn btn-primary col-3">
        Write a Review
      </Link>
    </div>
  );
}
